import React from "react";
import { Button, Input, Text } from "../atomes";
import { useAuth } from "../../context";

const Profil = () => {
  const { profile } = useAuth();

  return (
    <div className="m-20 flex flex-col items-center ">
      <div className="w-40 h-40 rounded-full bg-red-400 cursor-pointer hover:bg-red-950 transition-colors delay-150 ease-out"></div>
      <div className="mt-4">
        <Text.h3>{profile.username}</Text.h3>
      </div>
      <div className="mt-12 flex flex-col justify-center items-center">
        <div className="self-start pl-8">
          <Text.p>Informations de paiement :</Text.p>
        </div>
        <div className="w-72 h-40 bg-blue-500 rounded-md p-4">
          <Text.h4 color={"white"}>1234 5126 4865 6521 12</Text.h4>
          <Text.h4 color={"white"}>{profile.username}</Text.h4>
          <Text.h4 color={"white"}>11/25</Text.h4>
          <Text.h4 color={"white"}>123</Text.h4>
        </div>
        <div className="mt-6">
          <Button.Primary value={"Modifier les informations de paiement"} />
        </div>
      </div>
      <div className="mt-12">
        <Text.p>Adresse de livraison :</Text.p>
        <Input.Primary value={""} />
      </div>
    </div>
  );
};

export { Profil };
